      position: absolute;
      top: 50%;
      transform: translateY(-50%);
      width: 2rem;
      height: 2rem;
      margin: 0;
      padding: 0;
      border: 2px solid utility.$dive-red;
      border-radius: 50%;
      font-size: 2rem;
      font-weight: bold;
      line-height: 0;
      color: utility.$dive-red;
      background-color: transparent;
